export async function GET(event) {
    const dataURL = "data:image/png;base64,";
    const b64toBlob = await event.fetch(dataURL).then(res => res.blob())

    return new Response(b64toBlob, {
        status: 200,
        headers: {
            "Content-type": "image/png",
            "Content-Disposition": "attachment; filename=choodle.png"
        }
    })
}
